import React from 'react';

function Projects() {
  return React.createElement(
    'div',
    { className: 'p-8' },
    React.createElement('h2', { className: 'text-2xl font-bold mb-4' }, 'Projects'),
    React.createElement(
      'div',
      { className: 'grid gap-6 sm:grid-cols-2' },
      React.createElement(
        'div',
        { className: 'p-4 border rounded shadow' },
        React.createElement('h3', { className: 'font-semibold' }, 'Dish Craft'),
        React.createElement('p', { className: 'text-sm' }, 'A social cooking platform using MERN stack'),
        React.createElement(
          'a',
          { href: 'https://github.com/yourusername/dishcraft', className: 'text-blue-500' },
          'GitHub'
        )
      )
      // You can add more project cards here as additional children
    )
  );
}

export default Projects;
